import "semantic-ui-css/semantic.min.css";
import React, { useState } from "react";
import { Grid, Header, Segment, Table, Tab, Icon } from "semantic-ui-react";
import ApiCall from "../api/ApiCall";

const style = {
  h1: {
    marginTop: "2em",
    fontSize: "35px",
  },
  container: {
    marginLeft: 50,
    marginRight: 50,
  },
};

function RATP() {
  const [listeStations, setListeStations] = useState({});

  return (
    <div>
      <ApiCall setData={setListeStations}>
        https://api-ratp.pierre-grimaud.fr/v4/stations/metros/9
      </ApiCall>
      {displayStations(listeStations)}
      <Header as="h1" content="API RATP" textAlign="center" style={style.h1} />
      <Grid columns={2} stackable style={style.container}>
        <Grid.Row columns={1}>
          <Grid.Column>
            <Segment>
              <Table celled>
                <Table.Header>
                  <Table.Row>
                    <Table.HeaderCell>Name</Table.HeaderCell>
                    <Table.HeaderCell>Status</Table.HeaderCell>
                    <Table.HeaderCell>Notes</Table.HeaderCell>
                  </Table.Row>
                </Table.Header>

                <Table.Body>
                  <Table.Row>
                    <Table.Cell>No Name Specified</Table.Cell>
                    <Table.Cell>Unknown</Table.Cell>
                    <Table.Cell negative>None</Table.Cell>
                  </Table.Row>
                  <Table.Row positive>
                    <Table.Cell>Jimmy</Table.Cell>
                    <Table.Cell>
                      <Icon name="checkmark" />
                      Approved
                    </Table.Cell>
                    <Table.Cell>None</Table.Cell>
                  </Table.Row>
                  <Table.Row>
                    <Table.Cell>Jamie</Table.Cell>
                    <Table.Cell>Unknown</Table.Cell>
                    <Table.Cell positive>
                      <Icon name="close" />
                      Requires call
                    </Table.Cell>
                  </Table.Row>
                  <Table.Row negative>
                    <Table.Cell>Jill</Table.Cell>
                    <Table.Cell>Unknown</Table.Cell>
                    <Table.Cell>None</Table.Cell>
                  </Table.Row>
                </Table.Body>
              </Table>
            </Segment>
          </Grid.Column>
        </Grid.Row>
      </Grid>
    </div>
  );
}

export default RATP;

function displayStations(stations, pan) {
  if (typeof stations.result != "undefined") {
    stations.result.stations.map((data) => console.log(data));
  }
}
